import React,{ use } from "react";
import { My, _My } from "./app";

function First() {
  return (
    <>
      <My.Consumer>
        {(val) => {
          return (
            <_My.Consumer>
              {(_val) => {
                return (
                  <h1>
                    Hi {val} {_val}
                  </h1>
                );
              }}
            </_My.Consumer>
          );
        }}
      </My.Consumer>
    </>
  );
}

export default First;
